Does anyone have any recommendations for an easy natural science elective for EECS? These are the rules as outlined by the department: 

&#34;Students must complete one course from the following list: ASTRON 7A, 7B; BIOLOGY 1A and 1AL (must take both), 1B; CHEM 1A and 1AL (must take both), 1B, 3A and 3AL (must take both), 3B and 3BL (must take both), 4A, 4B; MCB 32 and 32L (must take both); PHYSICS 7C, 5C and 5CL (must take both); or an upper division course of 3 units or more in astronomy, chemistry (except 100, 149, 192), earth and planetary science (except C100), integrative biology (except 101, C105, 191), molecular cell biology, physics (except 100), or plant &amp; microbial biology.&#34;

I pretty much only have high school biology, chemistry, and physics so most of these courses seem pretty daunting. I would rather not do a lab class, but if there&#39;s no other option, I&#39;m ok with it
